import './App.css';
import { ChakraProvider,Box ,Container,Flex,CSSReset} from '@chakra-ui/react'
import { } from '@chakra-ui/icons'
import Navbar from './components/navBar';
import SideBar from './components/leftSideBar';


function App() {
  return (
    <ChakraProvider>
      <CSSReset />
      <Flex direction="column" height="100vh">
        <Navbar />
        <Flex flex="1">
          {/* Adjust the Box styling as needed */}
          <Box
            mx="2"
            my="2"
            borderRadius="2px"
            borderColor="blueviolet"
            bgColor="red"
            w="full"
            align="center"
            justify="center"
          >
            Hihi
          </Box>
        </Flex>
      </Flex>
    </ChakraProvider>
  );
}

export default App;
